import { Graph } from  'react-d3-graph' ;
import {Data} from './data'
import { config } from './config';
import './graph.css'

export const GraphView =() =>{
    return (
        <div>
            <Graph 
                id="graph-id" // уникальный ID для графа
                data={Data} //Данные для отображения
                config={config} //Сонфигурация графа
            />
        </div>
    )
}
